Here is the Solidity code according to your specification:

```solidity
pragma solidity 0.6.12;

contract ExchangeContract {

    address public admin;
    address public feeaccount;
    address public accountlevelsaddr;
    uint256 public feemake; 
    uint256 public feetake; 
    uint256 public feerebate; 
    mapping (address => mapping (address => uint256)) public balanceof;
    mapping (address => mapping (bytes32 => uint256)) public orders;
    mapping (address => mapping (bytes32 => uint256)) public orderfills;

    function order(address arg1, uint256 arg2, address arg3, uint256 arg4, uint256 arg5, uint256 arg6) public {
        bytes32 v0 = sha256(abi.encodePacked(address(this), arg1, arg2, arg3, arg4, arg5, arg6));
        orders[msg.sender][v0] = 1;
    }

    function cancelOrder(address arg1, uint256 arg2, address arg3, uint256 arg4, uint256 arg5, uint256 arg6, uint8 arg7, bytes32 arg8, bytes32 arg9) public {
        bytes32 v0 = sha256(abi.encodePacked(address(this), arg1, arg2, arg3, arg4, arg5, arg6));
        if(orders[msg.sender][v0] != 0) {
            orderfills[msg.sender][v0] = arg2;
        } else {
            address v1 = ecrecover(keccak256(abi.encodePacked("\x19Ethereum Signed Message:\n32", v0)), arg7, arg8, arg9);
            orderfills[msg.sender][v0] = arg2;
        }
    }

    function changeFeeMake(uint256 arg1) public {
        require(msg.sender == admin && arg1 <= feemake);
        feemake = arg1;
    }

    function withdraw(uint256 amount) public {
        require(balanceof[address(0)][msg.sender] >= amount);
        balanceof[address(0)][msg.sender] -= amount;
        msg.sender.transfer(amount);
    }

    function changeFeeAccount(address arg1) public {
        require(msg.sender == admin);
        feeaccount = arg1;
    }

    function changeFeeRebate(uint256 arg1) public {
        require(msg.sender == admin && arg1 >= feerebate && arg1 <= feetake);
        feerebate = arg1;
    }

    function changeAdmin(address arg1) public {
        require(msg.sender == admin);
        admin = arg1;
    }

    function depositToken(address arg1, uint256 arg2) public {
        require(arg1 != address(0));
        require(Token(arg1).transferFrom(msg.sender, address(this), arg2));
        balanceof[arg1][msg.sender] += arg2;
    }

    function changeFeeTake(uint256 arg1) public {
        require(msg.sender == admin && arg1 >= feerebate && arg1 <= feetake);
        feetake = arg1;
    }

    function changeAccountLevelsAddr(address arg1) public {
        require(msg.sender == admin);
        accountlevelsaddr = arg1;
    }

    function deposit() public payable {
        balanceof[address(0)][msg.sender] += msg.value;
    }

    function withdrawToken(address token, uint256 amount) public {
        require(amount <= balanceof[token][msg.sender]);
        balanceof[token][msg.sender] -= amount;
        require(Token(token).transfer(msg.sender, amount));
    }
}

interface Token {
    function transferFrom(address from, address to, uint256 value) external returns (bool);
    function transfer(address to, uint256 value) external returns (bool);
}
```

Please note that the `order`, `cancelOrder` and `amountFilled` functions are not fully implemented according to the specification because the `sha256` and `ecrecover` functions are used without any further logic and the `amountFilled` function does not perform any operation. Moreover, the `testTrade` and `availableVolume` functions are not implemented because they are not specified.
